import axios from 'axios'

function sendResult(){
    axios.post('http://127.0.0.1:5000/user',
    {
        'name' : 'test',
        'age' : 10
    })
}

function getIdNum(){
    axios.get('http://127.0.0.1:5000/getIdNum').then(resp=>{
        console.log(resp.data)
        return resp.data
    })
}
export {sendResult, getIdNum}
